import React from "react";
import ReactDOM from "react-dom";
import "./index.css";
import Card from "./Card";
import Sdata from "./Sdata"

const Ndata = (val) =>{
  return(
    <Card
       imgsrc={val.imgsrc}
        title={val.title}
        sname={val.sname}
        Link={val.Link}
    />
  )
}

ReactDOM.render(
  <>
    <h1 className=" text-center m-5 " >This Is Official Netflix Site</h1>

    {Sdata.map(Ndata)}
  </>,

  document.getElementById("root")
)
